FeedPackage.ReleaseNotes:
Version 4.60 added imperative way for adding indexes and ID fields for non-intrusive database object declarations (no attributes are required).

Extended information the user can get about types using DB.GetTypeInfo.

Book dummy = null;
// Sample syntax for creating or updating an existing type.
DB.TypeRules.IgnoreField(() => dummy.Publisher).
             IgnoreProperty(() => dummy.History).
             AddIndex(() => dummy.Name).
             AddIndex(() => dummy.Price).
             SetIDField(()=>dummy.MyID);

db.RegisterType(typeof(Book));

Please note that 4.60 database format is not compatible with 4.51

